import React from 'react';

const PaginationComponent = ({ filteredPages, landingPages }) => {
    return (
        <div className="pagination">
            <span>Đang hiển thị 1 đến {filteredPages.length} của {landingPages.length} bản ghi</span>
        </div>
    );
};

export default PaginationComponent;
